import React from "react";
import {Link} from "react-router-dom"

import Personalized_data_dispenser from "./Personalized_data_dispenser";

const Personalized_data_progresser = (props) => {

    switch(typeof props){

        case ('object'): return <React.Fragment>
            <Link to='/account'><p>My Account</p></Link>
            <Link to='/reviews'><p>My Reviews</p></Link>
            <Link to='/journals'><p>My Journals</p></Link>
            <Link to='/alarms'><p>Alarms</p></Link>
            <Link to='/options'><p>Options</p></Link>

        </React.Fragment>

        case ('undefined'): return 'none';
    }

}

export default Personalized_data_progresser;
